  \"2015-02-04T19:39:00.863295\",\n\t\"name\": \"chicago-traffic-tracker-congestion-estimates-by-segments-0b9d7\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains the current estimated
  speed for about 1250 segments covering 300 miles of arterial roads. For a more detailed
  description, go to: http://bit.ly/Q9AZAD. rnrnThe Chicago Traffic Tracker estimates
  traffic congestion on Chicagou2019s arterial streets (nonfreewayrnstreets) in real-time
  by continuously monitoring and analyzing GPS traces received from Chicago Transit
  Authority (CTA) buses. Two types of congestion estimates are produced every ten
  minutes: 1) by Traffic Segments and 2) by Traffic Regions or Zones. Congestion estimate
  by traffic segments gives the observed speed typically for one-half mile of a street
  in one direction of traffic.rnrnTraffic Segment level congestion is available for
  about 300 miles of principal arterials. Congestion by Traffic Region gives the average
  traffic condition for all arterial street segments within a region. A traffic region
  is comprised of two or three community areas with comparable traffic patterns. 29
  regions are created to cover the entire city (except Ou2019Hare airport area).rnThis
  dataset contains the current estimated speed for about 1250 segments covering 300
  miles of arterial roads.rnThere is much volatility in traffic segment speed. However,
  the congestion estimates for the traffic regions remain consistent for relatively
  longer period. Most volatility in arterial speed comes from the very nature of the
  arterials themselves. Due to a myriad of factors, including but not limited to frequentrnintersections,
  traffic signals, transit movements, availability of alternative routes, crashes,
  short length of the segments, etc. speed on individual arterial segments can fluctuate
  from heavily congested to no congestion and back in a few minutes. The segment speed
  and traffic region congestion estimatesrntogether may give a better understanding
  of the actual traffic conditions.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
